export const generateRandomString = () => {
  return 'expense' + Math.random().toString(36).substring(2, 7);
};

export const removeRow = (rows, uniqueId) => {
  console.log(rows, uniqueId);

  return rows.filter((row) => row.child.props.id !== uniqueId);
  // return updated row
};
